function TodoCheck({isDone, markTodoAsCompleted} ) {
    return (
        <TodoIcon
           type="check"
           color={isDone? 'green' : 'gry'}
           onClick={() => markTodoAsCompleted()}
       />        
    );
}
export {TodoCheck};
